import axios from "axios";

export const GetEmployeeDetails = async () => {
    let config = {
        method: "get",
        url: "/Employee/getAllEmployees",
    };
    return await axios.request(config).then((response) => {
        return response;
    });
};

export default {
    GetEmployeeDetails,
};
